        bubble_class:'StyleA',
        bubblestyle_d:'frurado',
        b_width:796,
        b_height:546,
        orientation:'C',
        b_duration:-1,
        position_bu:{ FP: '0', EP: new win_.ElementRef('0:0:0:0:1:0', 'images', 0, 0, ''), XY: {x:0.386725, y:0.260548}, DocXY: {x:0.386725, y:0.252369}},
